import React, {useEffect, useState} from "react";


const Post = ()=>{

    const [feed, setfeed] = useState([]);
    
    
    
  useEffect(()=>{
    const getPosts =  
         fetch('http://localhost:4000/feed', {
          method: "GET",
          credentials: "include"
        })
      getPosts.then(feed=>{
        setfeed(feed)
      })
  });
   
    return(
        <>
       </>
    )
}

export default Post;
